script: |
  super -f text -I q6994.spq | sort > q6994.out

inputs:
  - name: q6994.spq
    data: |
      SELECT DISTINCT col2 + col1 * + col0 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE NOT col2 * + col1 + - col0 * + col2 BETWEEN ( + 90 * 20 + 18 ) AND col1 * col0 - 60;
  - name: tab0

outputs:
  - name: q6994.out
    data: |
      1262
      1837
      196
